var PeaceRelay = artifacts.require("./PeaceRelay.sol");
var ETCLocking = artifacts.require("./ETCLocking.sol");
var ETCToken = artifacts.require("./ETCToken.sol");

EthProof  = require('../merkle-patricia-proof/lib/ethProof.js')
EthVerify = require('../merkle-patricia-proof/lib/ethVerify.js')
ethProof = new EthProof(new Web3.providers.HttpProvider("https://mainnet.infura.io"))



function parseBlock(peaceRelay, txData) {
  return new Promise((resolve, reject) => {
    return peaceRelay.submitBlock(txData.blockhash, txData.header).then(tx => {
      return peaceRelay.getStateRoot(txData.blockhash)
    }).then(parsedRoot => {
      assert.equal(parsedRoot, txData.stateRoot, "roots should match")
      return peaceRelay.getTxRoot(txData.blockhash)
    }).then(parsedRoot => {
      assert.equal(parsedRoot, txData.txRoot, "roots should match")
      return peaceRelay.getReceiptRoot(txData.blockhash)
    }).then(parsedRoot => {
      assert.equal(parsedRoot, txData.receiptRoot, "roots should match")
      resolve()
    })
  })
}

function checkTransaction(peaceRelay, txData, shouldPass) {
  return new Promise((resolve, reject) => {
    return peaceRelay.submitBlock(txData.blockhash, txData.header).then(() => {
      return peaceRelay.checkTxProof.call(txData.blockhash, txData.stack, txData.path, txData.prefix, txData.value)
    }).then(res => {
      assert.equal(res, shouldPass, "Should have returned " + shouldPass)
      resolve()
    })
  })
}

function checkReceipt(peaceRelay, txData, shouldPass) {
  return new Promise((resolve, reject) => {
    return peaceRelay.submitBlock(txData.blockhash, txData.header).then(() => {
      return peaceRelay.checkReceiptProof.call(txData.blockhash, txData.stack, txData.path, txData.prefix, txData.value)
    }).then(res => {
      assert.equal(res, shouldPass, "Should have returned " + shouldPass)
      resolve()
    })
  })
}


